import React from "react";
import s from './../Dialogs.module.css';
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    let path = "/dialogs/" + props.id;
    return (
        <div className={s.dialog + ' ' + s.active}>
            <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fcreate-react-app.dev%2Fdocs%2Fadding-images-fonts-and-files%2F&psig=AOvVaw02Wq57shRAs1f-pqnPGmWT&ust=1603764902768000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKD6r_6X0ewCFQAAAAAdAAAAABAS'/>
            <NavLink to={path}>{props.name}</NavLink>

        </div>
    )
}

export default DialogItem;
